    <script>
    $(document).on(""submit"", "".update-app-style"", function (event) {
        event.preventDefault();
        updateAppStyle($(this));
    });
    function updateAppStyle($form) {
        var json = $form.serialize();

        $.ajax({
            url: $form.attr('action'),
            type: $form.attr('method'),
            data: json
        }).done(function (data) {
            location.reload();
        });
    }
    </script>
